import React from "react";
import Book from "./Book";


function BookDetails(book){
    return(
        <>
        {/* {console.log({book}.book.book.volumeInfo.title)} */}
        {{book}.book.book.volumeInfo.title &&
            <h3 className="book__item-title">
              {{book}.book.book.volumeInfo.title}
            </h3>
          }
        </>
    )

}

export default BookDetails
